--

CREATE TABLE public.work_packages (
    id bigint NOT NULL,
    type_id bigint NOT NULL,
    project_id bigint NOT NULL,
    subject character varying DEFAULT ''::character varying NOT NULL,
    description text,
    due_date date,
    category_id bigint,
    status_id bigint NOT NULL,
    assigned_to_id bigint,
    priority_id bigint,
    version_id bigint,
    author_id bigint NOT NULL,
    lock_version integer DEFAULT 0 NOT NULL,
    done_ratio integer,
    estimated_hours double precision,
    created_at timestamp with time zone,
    updated_at timestamp with time zone,
    start_date date,
    responsible_id bigint,
    derived_estimated_hours double precision,
    schedule_manually boolean DEFAULT true NOT NULL,
    parent_id bigint,
    duration integer,
    ignore_non_working_days boolean DEFAULT false NOT NULL,
    derived_remaining_hours double precision,
    derived_done_ratio integer,
    "position" integer,
    story_points integer,
    remaining_hours double precision,
    budget_id integer,
    project_phase_definition_id bigint,
    CONSTRAINT work_packages_due_larger_start_date CHECK ((due_date >= start_date))
);


ALTER TABLE public.work_packages OWNER TO openproject_user;

--
-- Name: work_packages_id_seq; Type: SEQUENCE; Schema: public; Owner: openproject_user
--

CREATE SEQUENCE public.work_packages_id_seq
    START WITH 1
    INCREMENT BY 1
    NO MINVALUE
    NO MAXVALUE
    CACHE 1;


ALTER SEQUENCE public.work_packages_id_seq OWNER TO openproject_user;

--
-- Name: work_packages_id_seq; Type: SEQUENCE OWNED BY; Schema: public; Owner: openproject_user
--

ALTER SEQUENCE public.work_packages_id_seq OWNED BY public.work_packages.id;


--
-- Name: workflows; Type: TABLE; Schema: public; Owner: openproject_user
