19	1	2	1	3	custom_text	---\ntext: "![Teaser](/api/v3/attachments/1/content)"\nname: Le damos la bienvenida\n	6
20	2	5	1	2	custom_text	---\nname: Primeros pasos\ntext: |\n  Nos alegramos de tenerle con nosotros! Le sugerimos que pruebe algunas cosas para iniciarse en OpenProject.\n\n  Descubra las caractersticas ms importantes con nuestra [Visita guiada]({{opSetting:base_url}}/projects/demo-project/work_packages/?start_onboarding_tour=true).\n\n  _Pruebe los siguientes pasos:_\n\n  1. *Invitar a nuevos miembros a su proyecto*: &rightarrow; Vaya a [Miembros]({{opSetting:base_url}}/projects/demo-project/members) en la navegacin del proyecto.\n  2. *Consultar el trabajo en su proyecto*: &rightarrow; Vaya a [Paquetes de trabajo]({{opSetting:base_url}}/projects/demo-project/work_packages) en la navegacin del proyecto.\n  3. *Crear un nuevo paquete de trabajo*: &rightarrow; Vaya a [Paquetes de trabajo &rightarrow; Crear]({{opSetting:base_url}}/projects/demo-project/work_packages/new).\n  4. *Crear y actualizar un plan de proyecto*: &rightarrow; Vaya a [Plan de proyecto]({{opSetting:base_url}}/projects/demo-project/work_packages?query_id=1) en la navegacin del proyecto.\n  5. *Activar ms mdulos*: &rightarrow; Vaya a [Configuracin del proyecto &rightarrow; Mdulos]({{opSetting:base_url}}/projects/demo-project/settings/modules).\n  6. *Completar sus tareas en el proyecto*: &rightarrow; Vaya a [Paquetes de trabajo &rightarrow; Tareas]({{opSetting:base_url}}/projects/demo-project/work_packages/details/3/overview?query_id=3).\n\n  Aqu encontrar nuestras [Guas del usuario](https://www.openproject.org/docs/user-guide/).\n  Hganos saber si tiene alguna pregunta o necesita ayuda. Pngase en contacto con nosotros: [support[at]openproject.com](mailto:support@openproject.com).\n	6
