27	2	5	1	2	custom_text	---\nname: Primeros pasos\ntext: |\n  Nos alegra que te hayas unido! Te sugerimos probar algunas cosas para empezar en OpenProject.\n\n  _Prueba los siguientes pasos:_[Backlogs]. *Invitar nuevos miembros a tu proyecto*: &rightarrow; Ir a [Members]({{opSetting:base_url}}/projects/your-scrum-project/members) en la navegacin del proyecto.\n  2. *Ver el registro de tu producto y los backlogs de Sprint*: &rightarrow; Ir a [Backlogs]({{opSetting:base_url}}/projects/your-scrum-project/backlogs) en la navegacin del proyecto.\n  3. *Ver el tablero de tareas*: &rightarrow; Ir a [Backlogs] ({{opSetting:base_url}}/projects/your-scrum-project/backlogs) &rightarrow; Haga clic en la flecha derecha en Sprint &rightarrow; Seleccione [Task Board](/projects/your-scrum-project/sprints/3/taskboard).\n  4. *Crear un nuevo paquete de trabajo*: &rightarrow; Ir a [Paquetes de trabajo &rightarrow; Crear]({{opSetting:base_url}}/projects/your-scrum-project/work_packages/new).\n  5. *Crear y actualizar un plan de proyecto*: &rightarrow; Ir a [Plan del proyecto](/projects/your-scrum-project/work_packages?query_id=15) en la navegacin del proyecto.\n  6. *Crea un wiki de Sprint*: &rightarrow; Ir a [Backlogs]({{opSetting:base_url}}/projects/your-scrum-project/backlogs) y abre el wiki de sprint desde el men desplegable derecho en un sprint. Puedes editar la [wiki template]({{opSetting:base_url}}/projects/your-scrum-project/wiki/) en funcin de tus necesidades.\n  7. *Activar ms mdulos*: &rightarrow; Ir a [Configuracin del proyecto &rightarrow; Mdulos]({{opSetting:base_url}}/projects/your-scrum-project/settings/modules).\n\n  Aqu encontrars nuestras [Guas de usuario](https://www. penproject.org/docs/user-guide/).\n  Por favor, hganos saber si tienes alguna pregunta o necesitas ayuda. Contctanos: [support[at]openproject.com](mailto:support@openproject.com).\n	7
