1	4	_En esta wiki puede crear y editar en colaboracin pginas y subpginas para crear un wiki de proyecto._\n\n**Puede:**\n\n* Insertar texto e imgenes, tambin utilizando copiar y pegar desde otros documentos\n* Crear una jerarqua de pginas con pginas padre\n* Incluir pginas wiki en el men del proyecto\n* Utilizar macros para incluir, por ejemplo, ndices, listas de paquetes de trabajo o diagramas de Gantt\n* Incluir pginas wiki en otros campos de texto, por ejemplo, pgina de resumen del proyecto\n* Incluir enlaces a otros documentos\n* Ver el historial de cambios\n* Ver como Markdown\n\nMs informacin: [https://www.openproject.org/docs/user-guide/wiki/](https://www.openproject.org/docs/user-guide/wiki/)\n
2	1	### Reunin de planificacin del Sprint\n\n_Documente aqu los temas para la reunin de planificacin del Sprint_\n\n* Con caja de tiempo (8 h)\n* Entrada: Backlogs del producto\n* Salida: Backlogs de Sprint\n\n* Dividido en dos cajas de tiempo adicionales de 4 h:\n\n    * El Propietario del producto presenta el [Backlog del Producto]({{opSetting:base_url}}/projects/your-scrum-project/backlogs) y las prioridades al equipo y explica el Objetivo del Sprint, con el que el equipo debe estar de acuerdo. Juntos, priorizan los temas del Backlog del Producto de los que se ocupar el equipo en el siguiente sprint. El equipo se compromete a la entrega acordada.\n    * El equipo planifica de forma autnoma (sin el Propietario del producto) en detalle y desglosa las tareas a partir de los requisitos discutidos para consolidar un [Backlog de Sprint]({{opSetting:base_url}}/projects/your-scrum-project/backlogs).\n\n\n### Reunin diaria de Scrum\n\n_Documente aqu los temas a tratar en la reunin diaria de Scrum_\n\n* Breve reunin diaria de estado del equipo.\n* Caja de tiempo (mx. 15 min).\n* Reunin de pie para discutir los siguientes temas del [Tabln de tareas](/projects/your-scrum-project/sprints/3/taskboard).\n    * Qu tengo previsto hacer hasta el prximo Scrum diario?\n    * Qu ha bloqueado mi trabajo (Impedimentos)?\n* El Scrum Master modera y anota los [Impedimentos del Sprint](/projects/your-scrum-project/sprints/3/taskboard).\n* El Propietario del producto puede participar para mantenerse informado.\n\n### Reunin de revisin del Sprint\n\n_Documente aqu los temas a tratar en la reunin de Revisin del Sprint_.\n\n* Caja de tiempo (4 h).\n* Un mximo de una hora de tiempo de preparacin por persona.\n* El equipo muestra al Propietario del producto y a otras personas interesadas lo que se ha conseguido en este sprint.\n* Importante: nada de maniques ni de PowerPoint! Solo debe demostrarse la funcionalidad del producto terminado (incrementos).\n* Los comentarios del Propietario del producto, de las partes interesadas y de otras personas son bienvenidos y se incluirn en el trabajo posterior.\n* Basndose en las funcionalidades demostradas, el Propietario del producto decide poner en marcha este incremento o desarrollarlo ms. Esta posibilidad permite un ROI temprano.\n\n\n### Retrospectiva del sprint\n\n_Documente aqu los temas de la reunin de Retrospectiva del Sprint_.\n\n* Caja de tiempo (3 h).\n* Despus de la Revisin del Sprint, ser moderada por el Scrum Master.\n* El equipo discute el sprint: lo que fue bien, lo que hay que mejorar para ser ms productivos para el prximo sprint o incluso divertirse ms.\n
